import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

import WelcomePage from './pages/WelcomePage';
import Analytics from './pages/Analytics';
import Settings from './pages/Settings';
import FocusMode from './pages/FocusMode';
import StudyChallenge from './pages/StudyChallenge';
import RewardSystem from './pages/RewardSystem';
import DistractionDetector from './pages/DistractionDetector';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-50">
        {/* Simple Navbar */}
        <nav className="bg-white shadow p-4 flex gap-6 text-blue-600 font-medium">
          <Link to="/">Welcome</Link>
          <Link to="/analytics">Analytics</Link>
          <Link to="/settings">Settings</Link>
        </nav>

        <Routes>
          <Route path="/" element={<WelcomePage />} />
          <Route path="/analytics" element={<Analytics />} />
          <Route path="/settings" element={<Settings />} />
          <Route path="/focus" element={<FocusMode />} />
          <Route path="/distraction" element={<DistractionDetector />} />
          <Route path="/challenge" element={<StudyChallenge />} />
          <Route path="/reward" element={<RewardSystem />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
